import styled from '@emotion/styled'
import { Paper } from '@mui/material'
import React from 'react'

const LoginWrap = styled(Paper)(({ theme }) => ({
    borderRadius: 15,
    height: 300,
    overflow: 'hidden',
    display: 'flex',
    alignItems: 'center',
    [theme.breakpoints.down('md')]: {
        height: 150
    },
    [theme.breakpoints.down('sm')]: {
        display: 'none'
    }
}))
export default function Login() {
    return (
        <LoginWrap>
        </LoginWrap>
    )
}
